import React from "react";
import Background from "../media/99.jpg"

const Err404 = () => {
    return(
        <div style={{ display:'flex', flexDirection:'column', justifyContent:'center', alignItems:'center',backgroundImage:`url(${Background})`, backdropFilter:'blur(5px)', backgroundSize:'cover', height:'calc(100vh - 100px)' }}>
            <p style={{ color:'#f33', fontFamily:'Quicksand', fontWeight:'600', fontSize:'90px'}}>404 Error</p>
            <p style={{ fontStyle:'italic', fontSize:'24px'}}>Invalid page. Visit one of the links in the navigation bar above.</p>
        </div>
    )
}
export default Err404
